let data;

const fetchGeoData =(userInput) => {
  const promise = new Promise((resolve, reject) => {
    let request = new XMLHttpRequest();
    request.responseType = "json";
    request.open("GET", "http://api.geonames.org/searchJSON?q="+userInput+"&maxRows=100&username=weknowit")
    request.send();
    request.onload = () => {
      console.log(request);
      if(request.status == 200){
        resolve(request.response)
      }
      else{
        console.log('error')
        reject(request.response)
      }
    }
  });
  return promise;
}

export {fetchGeoData};



